import Topo from "./componentes/Topo";
import EspacoBotoes from "./componentes/EspacoBotoes";
import EspacoJogos from "./componentes/EspacoJogos";
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {

  const caminhoJogos = [
    {
      path: 'nao-nomeado',
      aparecerJogo: 'Não Nomeado'
    },
    {
      path: 'nao-nomeado',
      aparecerJogo: 'Dash and Get Out'
    },
    {
      path: 'nao-nomeado',
      aparecerJogo: 'Square Problems'
    },
    {
      path: 'nao-nomeado',
      aparecerJogo: 'Pech'
    },
    {
      path: 'nao-nomeado',
      aparecerJogo: 'Save Vein'
    },
    {
      path: 'nao-nomeado',
      aparecerJogo: 'Lights Come Back'
    }
  ]

  return (
    <div className="App">

      <BrowserRouter>
        <Topo />
        <EspacoBotoes />
        <Routes>
          <Route path="/" element=''/>
          <Route path="nao-nomeado" element={<EspacoJogos aparecerJogo='Não Nomeado' />} />
          <Route path="dash-and-get-out" element={<EspacoJogos aparecerJogo='Dash and Get Out' />} />
          <Route path="square-problems" element={<EspacoJogos aparecerJogo='Square Problems' />} />
          <Route path="pech" element={<EspacoJogos aparecerJogo='Pech' />} />
          <Route path="save-vein" element={<EspacoJogos aparecerJogo='Save Vein' />} />
          <Route path="lights-come-back" element={<EspacoJogos aparecerJogo='Lights Come Back' />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
